    "Use Current Transcript": "Utiliser la transcription courante",
    "Use Onboarding to introduce learners to proctoring, verify their identity, and create an onboarding profile. Learners must complete the onboarding profile step prior to taking a proctored exam. Profile reviews take 2+ business days.": "Utilisez l'int\u00e9gration pour initier les apprenants \u00e0 la supervision, v\u00e9rifier leur identit\u00e9 et cr\u00e9er un profil d\u2019int\u00e9gration. Les apprenants doivent compl\u00e9ter l\u2019\u00e9tape du profil d\u2019int\u00e9gration avant de passer un examen surveill\u00e9. Les \u00e9valuations de profil prennent plus de 2 jours ouvrables.",
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "Utilisez un examen de pratique surveill\u00e9 afin d'introduire les apprenants au processus et aux outils de surveillance. Les r\u00e9sultats d'un examen de pratique ne comptent pas pour la note finale de l'\u00e9tudiant.",
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "Utilisez un examen surveill\u00e9 afin de limiter le temps que les apprenants peuvent passer sur les probl\u00e8mes dans cette sous-section. Les apprenants doivent soumettre leurs r\u00e9ponses avant que le temps n'expire. Vous pouvez ajouter du temps additionnel par apprenant via le tableau de bord de l'instructeur.",
    "Use as a Prerequisite": "Utilis\u00e9 comme Pr\u00e9-requis",
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, click \"Bookmark this page\" under the page title.": "Utilisez les signets afin de vous aider \u00e0 retourner facilement aux pages de cours. Pour ajouter un signet, s\u00e9lectionnez Signets sous le titre de la page.",
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "Utilisez les cohortes comme base pour diviser les discussions. Tous les apprenants, ind\u00e9pendamment de leur cohorte, voient les m\u00eames sujets de discussion, mais dans des sujets divis\u00e9s, seuls les membres d'une m\u00eame cohorte voient et r\u00e9pondent aux messages de chacun.",
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "Utilisez les parcours d'inscription comme base pour diviser les discussions. Tous les apprenants, ind\u00e9pendamment de leur parcours d'inscription, voient les m\u00eames sujets de discussion, mais dans des sujets divis\u00e9s, seuls les apprenants qui sont dans le m\u00eame parcours d'inscription voient et r\u00e9pondent aux messages de chacun.",
