    "We have encountered an error. Refresh your browser and then try again.": "Nous avons rencontr\u00e9 une erreur. Rafra\u00eechissez votre navigateur puis r\u00e9essayez.",
    "We have received your information and are verifying your identity. You will see a message on your dashboard when the verification process is complete (usually within 5-7 days). In the meantime, you can still access all available course content.": "Nous avons re\u00e7us vos informations et nous v\u00e9rifions votre identit\u00e9. Un message sera visible sur votre tableau de bord (5-7 jours de d\u00e9lai). Entre temps, vous avez toujours acc\u00e8s \u00e0 l'ensemble du cours.",
    "We just need a little more information before you start learning with %(platformName)s.": "Nous avons juste besoin d'un peu plus d'informations avant que vous commenciez votre apprentissage avec %(platformName)s.",
    "We securely encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Nous encryptons s\u00e9curitairement vos photos et les envoyons \u00e0 notre service d'authentification pour r\u00e9visions. Vos photos et vos informations ne seront pas sauvegard\u00e9es et ne seront pas disponibles sur %(platformName)s apr\u00e8s que le processus de v\u00e9rification soit compl\u00e9t\u00e9.",
    "We use the highest levels of security available to encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Nous utilisons les plus hauts niveaux de s\u00e9curit\u00e9 disponibles pour chiffrer votre photo et l'envoyer \u00e0 notre service d'autorisation pour examen. Votre photo et les informations ne sont pas enregistr\u00e9s ou visibles sur %(platformName)s apr\u00e8s que le processus de v\u00e9rification soit termin\u00e9.",
    "We use your verification photos to confirm your identity and ensure the validity of your certificate.": "Nous utilisons les photos de v\u00e9rifications pour confirmer votre identit\u00e9 et assurer la validit\u00e9 de votre attestation.",
    "We're sorry to see you go! Your account will be deleted shortly.": "Nous sommes d\u00e9sol\u00e9s de vous voir quitter! Votre compte sera bient\u00f4t supprim\u00e9.",
