    "You haven't added any textbooks to this course yet.": "Vous n'avez encore ajout\u00e9 aucun manuel \u00e0 ce cours.",
    "You may access your account with this address if single-sign on or access to your primary email is not available.": "Vous pouvez acc\u00e9der \u00e0 votre compte avec cette adresse si la connexion unique ou l'acc\u00e8s \u00e0 votre courrier \u00e9lectronique principal n'est pas disponible.",
    "You may also lose access to verified certificates and other program credentials like MicroMasters certificates. If you want to make a copy of these for your records before proceeding with deletion, follow the instructions for {htmlStart}printing or downloading a certificate{htmlEnd}.": "Vous pouvez \u00e9galement perdre l'acc\u00e8s aux attestations v\u00e9rifi\u00e9es et \u00e0 d'autres informations d'identification de programme, comme les attestations MicroMasters. Si vous souhaitez en faire une copie pour vos dossiers avant de proc\u00e9der \u00e0 la suppression, suivez les instructions pour {htmlStart}l'impression ou le t\u00e9l\u00e9chargement d'une attestation{htmlEnd}.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally the best position for a headshot is approximately 12-18 inches (30-45 centimeters) from the camera, with your head centered relative to the computer screen. ": "Vous pourriez compl\u00e9ter le processus de capture d'image sans assistance, mais vous pourriez avoir \u00e0 le refaire plusieurs fois pour bien positionner la cam\u00e9ra. L'emplacement id\u00e9al varie d'un appareil \u00e0 l'autre, mais g\u00e9n\u00e9ralement la meilleure position pour la photo du visage est approximativement de 30 \u00e0 45 centim\u00e8tres (12 \u00e0 18 pouces) de la cam\u00e9ra, avec votre t\u00eate centr\u00e9e relativement \u00e0 celle-ci.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally, the best position for a photo of an ID card is 8-12 inches (20-30 centimeters) from the camera, with the ID card centered relative to the camera. ": "Vous pourriez compl\u00e9ter le processus de capture d'image sans assistance, mais vous pourriez avoir \u00e0 le refaire plusieurs fois pour bien positionner la cam\u00e9ra. L'emplacement id\u00e9al varie d'un appareil \u00e0 l'autre, mais g\u00e9n\u00e9ralement la meilleure position pour la photo de la pi\u00e8ce d'identit\u00e9 est approximativement de 30 \u00e0 45 centim\u00e8tres (12 \u00e0 18 pouces) de la cam\u00e9ra, avec votre pi\u00e8ce d'identit\u00e9 centr\u00e9e relativement \u00e0 votre cam\u00e9ra.",
    "You must be over 13 to share a full profile. If you are over 13, make sure that you have specified a birth year on the {account_settings_page_link}": "Vous devez avoir plus de 13 ans pour partager un profil complet. Si vous avez plus de 13 ans, assurez-vous que votre ann\u00e9e de naissance est correcte dans {account_settings_page_link}",
