    "You need a valid ID that contains your full name and photo.": "Vous avez besoin d'une pi\u00e8ce d'identit\u00e9 valide contenant votre nom complet et de votre photo.",
    "You need an ID with your name and photo. A driver's license, passport, or ID are all acceptable.": "Vous avez besoin d'une pi\u00e8ce d'identit\u00e9 avec votre nom et votre photo. Un permis de conduire ou un passeport sont bons.",
